import "./index.css";
import PATHS from "./Utils/paths";
import HeaderOne from "./Components/HeaderOne";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./Pages/Home";
import Account from "./Pages/Account";
import TvShows from "./Pages/TvShows";
import Movies from "./Pages/Movies";
import Login from "./Pages/Login";
import { useEffect, useState } from "react";
import { options } from "../Utils/options";
function App() {
  const [searchValue, setSearchValue] = useState("");

  useEffect(() => {
    fetch(
      `https://api.themoviedb.org/3/movie/upcoming?language=en-US&page=1`,
      options
    )
      .then((response) => response.json())
      .then((data) => {
        console.log("WE GET ALL DATA");
        setMovies(data.results);
      })
      .catch((err) => console.error(err));
  }, []);

  return (
    <div className='body-info'>
      <Router>
        <HeaderOne />
        <Routes>
          <Route
            path={PATHS.HOME}
            element={
              <Home searchValue={searchValue} setSearchValue={setSearchValue} />
            }
          />
          <Route path={PATHS.ACCOUNT_APP} element={<Account />} />
          <Route path={PATHS.TVSHOWS_APP} element={<TvShows />} />
          <Route path={PATHS.MOVIES_APP} element={<Movies />} />
          <Route path={PATHS.LOGIN_APP} element={<Login />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
